import React, { useState } from "react";
import './Home.css';

function Home() {
  const [selectedGender, setSelectedGender] = useState(null);
  const [selectedSearch, setSelectedSearch] = useState(null);
  const [selectedTag,setSelectedTag] = useState(null);

  const handleGenderClick = (gender) => {
    setSelectedGender(gender);
  };

  const handleSearchClick = (search) => {
    setSelectedSearch(search);
  };
  const handleTagClick = (tag) => {
    setSelectedTag(tag);
  }

  return (
    <div className='Parent'>
      <div className="Child">
        <div className="nickName">
          <img className='icon' src="/images/icon.png" alt="" />
          <img className='edit' src="/images/vector.png" alt="" />
          <a className='text' href="">Nickname</a>
        </div>
        <div className="container">
          <div className="gender">
            <p>Your Gender (Be real)?</p>
            <div className="buttons">
              <button 
                className={`male ${selectedGender === 'male' ? 'active' : ''}`} 
                onClick={() => handleGenderClick('male')}
              >
                Male
              </button>
              <button 
                className={`female ${selectedGender === 'female' ? 'active' : ''}`} 
                onClick={() => handleGenderClick('female')}
              >
                Female
              </button>
              <button 
                className={`other ${selectedGender === 'other' ? 'active' : ''}`} 
                onClick={() => handleGenderClick('other')}
              >
                Other
              </button>
            </div>
          </div>
          <div className="search">
            <p>Who are you looking for?</p>
            <div className="buttons">
              <button 
                className={`male ${selectedSearch === 'male' ? 'active' : ''}`} 
                onClick={() => handleSearchClick('male')}
              >
                Male
              </button>
              <button 
                className={`female ${selectedSearch === 'female' ? 'active' : ''}`} 
                onClick={() => handleSearchClick('female')}
              >
                Female
              </button>
              <button 
                className={`other ${selectedSearch === 'other' ? 'active' : ''}`} 
                onClick={() => handleSearchClick('other')}
              >
                Other
              </button>
            </div>
            <div className="message">
              <p>This doesn't ensure that you will always <br />get the selected gender. This just gives <br />priority to the selected gender</p>

            </div>
          </div>
          <div className="Tags">
            <p>Tags</p>
            <div className="buttons">
              <button
              className={`love ${selectedTag === 'love' ? 'active' : ''}`} 
              onClick={() => handleTagClick('love')}
              >Love</button>
              <button
              className={`game ${selectedTag === 'game' ? 'active' : ''}`} 
              onClick={() => handleTagClick('game')}
              >Games</button>
              <button
              className={`music ${selectedT === 'music' ? 'active' : ''}`} 
              onClick={() => handleSearchClick('music')}
              >Music</button>
              <button
              className={`movie ${selectedSearch === 'movie' ? 'active' : ''}`} 
              onClick={() => handleSearchClick('movie')}
              >Movies</button>
              <button
              className={`add ${selectedSearch === 'add' ? 'active' : ''}`} 
              onClick={() => handleSearchClick('add')}
              >+Add more</button>

            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
